The invention provides a manufacturing method of a metal-supported solid oxide fuel cell (50) comprising a permeable substrate (200). The method comprises the steps of: 
providing a substrate body (S20); 
forming a plurality of gas channels (112) on the substrate body by using a drilling process (S21); 
forming a permeable powder layer (260) on the substrate body (S22) by using further steps of: 
forming a green layer (of permeable powder layer (260) by a tape caster, sintering the green layer into a permeable powder layer (260) by using a high temperature sintering process, disposing the sintered permeable powder layer (260) onto the substrate body and making them laminated and connected together by using high temperature pressing process; 
reducing the surface pore sizes of the permeable powder layer (260) to be smaller than 30 μm (S24) ; 
using a high temperature pressing process (S25) to flatten a permeable metal substrate (200); 
and using an atmospheric plasma spraying process (S26) to sequentially form a porous anode layer (52), a dense anode isolation layer (53), a dense electrolyte layer (54), a dense cathode isolation layer (55) and a porous cathode layer (56) on the permeable metal substrate (100, 200).
